import React from 'react'
import ReactDOM from 'react-dom'
import './snake.css'
let mat=[]
let count=0
for(let i=0;i<40;i++)
{
    let temp=[]
    for(let j=0;j<75;j++)
    temp.push(0);
    mat.push(temp)
}
let refs=[]
refs=JSON.parse(JSON.stringify(mat))
class Board extends React.Component{
    render()
    {
        return(
            <div className='Board'>
               {mat.map((mat)=><Row mat={mat}/>)}
            </div>
        )
    }
}
class Row extends React.Component{
    constructor(props)
    {
        super(props)
    }
    render(){
        return(
            <div className='Row'>
            {this.props.mat.map((ele)=><Element />)}
            </div>
        )
    }
}
class Element extends React.Component{
    constructor(){
        super()
        refs[10][10]=this;
    }
    alert(){
        this.style.backgroundColor="black"    
    }
    render(){
        return(
            <div className='Element' id='1'>

            </div>
        )
    }
}
function start(){
    let i=0;
    while(i<count)
    {
    setTimeout(()=>{
        let t=document.getElementById(i++)
        t.style.backgroundColor='black'
    },500)
     }
}
export default {Board,refs}
